// ComparisonChart.js
import React from 'react';
import './ComparisonChart.css';

const comparisonData = [
  {
    feature: 'Responsive Design',
    lowTier: 'Yes',
    midTier: 'Yes',
    highTier: 'Yes',
    platinumTier: 'Yes',
  },
  {
    feature: 'Custom Pages',
    lowTier: '3 Pages',
    midTier: '10 Pages',
    highTier: '20+ Pages',
    platinumTier: 'Fully Custom',
  },
  {
    feature: 'E-Commerce',
    lowTier: 'No',
    midTier: 'Basic',
    highTier: 'Advanced',
    platinumTier: 'Enterprise',
  },
  {
    feature: 'SEO Optimization',
    lowTier: 'Basic',
    midTier: 'On-Page',
    highTier: 'Advanced',
    platinumTier: 'Full Service',
  },
  {
    feature: 'Support',
    lowTier: 'Limited',
    midTier: 'Standard',
    highTier: 'Ongoing',
    platinumTier: 'Dedicated',
  },
];

const ComparisonChart = () => {
  return (
    <div className="comparison-chart">
      <h3>Compare Our Packages</h3>
      <table>
        <thead>
          <tr>
            <th>Features</th>
            <th>Low Tier</th>
            <th>Mid Tier</th>
            <th>High Tier</th>
            <th>Platinum Tier</th>
          </tr>
        </thead>
        <tbody>
          {comparisonData.map((row, index) => (
            <tr key={index}>
              <td>{row.feature}</td>
              <td>{row.lowTier}</td>
              <td>{row.midTier}</td>
              <td>{row.highTier}</td>
              <td>{row.platinumTier}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ComparisonChart;
